import Slider from '@material-ui/core/Slider'
import ButtonGroup from '@material-ui/core/ButtonGroup';
import Button from '@material-ui/core/Button'

const Form = () => {
    return (
        <div className = "form">
            <h2>Focus
                <ButtonGroup color="white" aria-label="outlined primary button group" style={{borderColor: "white", color: "white", marginLeft: "10px"}}>
                <Button style={{ backgroundColor: "white", borderColor:"white"}}> Upper Body </Button>
                <Button>Cardio</Button>
                <Button>Legs/Glutes</Button>
            </ButtonGroup>
            </h2>
            <h2>Level <Slider style={{width: "120px", marginLeft:"10px"}}
            ></Slider></h2>

            <h2>Time commitment <Slider style={{width: "120px", marginLeft:"10px", marginTop:"10px"}}
            ></Slider></h2>


            <button className = "challengebutton"> CHALLENGE MODE!</button>
            <button className = "challengebutton"> Let's Go!</button>
        </div>
      );
}

export default Form;
